import React from 'react';
import './AnimatedText.css';

const AnimatedText = () => {
  return (
    <div className="animated-container">
     <h1 class="typing-effect-wrapper">
    <span class="typing-effect">Hi,</span>
    <span class="typing-effect">I'm Tharushika</span>
    <span class="typing-effect">Navodi,</span><br />
    <span class="typing-effect">A Fresh Graduate</span>
    <span class="typing-effect">Ready to Explore</span>
  </h1>
    </div>
  );
};

export default AnimatedText;
